The issue at line 1028 indicates that the file unexpectedly ends after:

```json
      }
    }
  },
```

### Exactly what's causing the error:

The JSON file abruptly ends at line 1027-1028 without completing the necessary closing braces for the entire JSON object. Essentially, your JSON document is incomplete.

### ✅ **Exact copy/paste fix:**

At the very end of your `conductor_config.json`, add this single closing brace on a new line to properly close your JSON object:

```json
}
```

### **Example (final lines after fix)**:

```json
      }
    }
  },
}
```

**should become**:

```json
      }
    }
  }
}
```

### **Next Steps**:

- Add this brace (`}`) to the end of your `conductor_config.json`.
- Rerun your command to confirm the file loads successfully.

Your JSON config will then be completely valid.
